import Header from "../_layouts/_includes/header/Header";
import Content from "../_layouts/_includes/content/Content";
import Footer from "../_layouts/_includes/footer/Footer";
import Background from "../_layouts/default/Background";
import styled from 'styled-components'

const Foot = styled.div`
    position: relative;
    text-align: left;
    width: auto;
    font-size: 12px;
    color: #8F98A0;
    border: 0;
    margin: 0;
    padding: 32px 0;
    background-color: rgba( 0, 0, 0, 0.4 );
`


class ShowcaseContainer extends Component {

    constructor(props) {
        super(props)
        this.state = {}
    }

    render() {
        return (
            <>
                <Background>
                    <Header user/>

                    <Content>
                    </Content>

                    <Foot />
                    {/*<Footer/>*/}
                </Background>
            </>
        )
    }
}

export default ShowcaseContainer
